Warner Batchelor (15 October 1934 &ndash; 11 February 2016) was an Australian boxer. He competed in the men's flyweight event at the 1956 Summer Olympics. In his first fight, he defeated Henryk Kukier of Poland, before losing to John Caldwell of Ireland in his next bout.
